import React from 'react';

function App() {
  const people = [
    {
      name : 'Sonny'
    },
    {
      name: 'Fiko'
    },
    {
      name: 'Vinsen'
    }
  ]
  return (
    <div className="App">
      <h1>React People</h1>
      <ul>
        {people.map(person => (
          <li>{person.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
